import React,{useState, useEffect} from 'react'
//import Table from '@material-ui/core/Table';
//import TableBody from '@material-ui/core/TableBody';
//import TableCell from '@material-ui/core/TableCell';
//import TableContainer from '@material-ui/core/TableContainer';
//import TableHead from '@material-ui/core/TableHead';
//import TableRow from '@material-ui/core/TableRow';
//import Paper from '@material-ui/core/Paper';
//import { DeleteOutline,Edit } from '@material-ui/icons';
import { Link} from 'react-router-dom'
import './dificultList.css'
const axios = require('axios');

export default function DificultList() {


    const [dificults, setDificults] = useState([])

    useEffect(() =>{
            axios.get('http://67.205.155.156:4500/api/dificultad')
            .then(res => {setDificults(res.data)})
            .catch(console.log)
   },[setDificults]) 



    return (
        <div className='dificultList'>
            <h1>Dificultades</h1>
        </div>
    )
}

